INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("あたしだって\nやるときはやるよ！", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 1, 0, 1, 0.0, "2020/04/30 12:00:00", 24001, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("ふぅ…\nこれであたしの仕事は\n終わりだね", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 1, 1, 1, 0.0, "2020/04/30 12:00:00", 24002, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("終わった終わった\n一人でもなんとか\nなるもんだね", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 1, 2, 1, 0.0, "2020/04/30 12:00:00", 24003, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("やったね！\nこれでようやく\nサボれるよ…", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 2, 3, 2, 0.0, "2020/04/30 12:00:00", 24004, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 1, 4, 1, 0.0, "2020/04/30 12:00:00", 24005, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("あたしを敵に回した\n恐ろしさ\n思い知ったか！", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 2, 5, 2, 0.0, "2020/04/30 12:00:00", 24006, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("あたしも意外と\nやるもんでしょ？", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 2, 6, 2, 0.0, "2020/04/30 12:00:00", 24007, 10040);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES ("疲れた…\nねずみの逃げ足\n速すぎるよ…", 102601, 24, "2030/12/17 14:59:59", "リン", 0.0, 0.0, 4, 7, 4, 0.0, "2020/04/30 12:00:00", 24008, 10040);
